import{_ as e,o,c as p,a}from"./app.dad05bb1.js";const c={},r=a('<h2 id="常用命令" tabindex="-1"><a class="header-anchor" href="#常用命令" aria-hidden="true">#</a> 常用命令</h2><p># 升级至最新版本 dectl upgrade</p><h3 id="查看-dataease-状态-dectl-status" tabindex="-1"><a class="header-anchor" href="#查看-dataease-状态-dectl-status" aria-hidden="true">#</a> 查看 DataEase 状态 dectl status</h3><h3 id="重新启动后-需要录入的命令" tabindex="-1"><a class="header-anchor" href="#重新启动后-需要录入的命令" aria-hidden="true">#</a> 重新启动后，需要录入的命令</h3><p>service docker restart</p><p>sudo dectl start</p><p>[root@localhost ~]# yum list installed | grep docker docker-ce.x86_64 18.06.1.ce-3.el7 @docker-ce-stable</p><p>[root@localhost ~]# yum remove -y docker-ce.x86_64 已加载插件：fastestmirror, langpacks 正在解决依赖关系 –&gt; 正在检查事务 —&gt; 软件包 docker-ce.x86_64.0.18.06.1.ce-3.el7 将被 删除 –&gt; 解决依赖关系完成</p><p>依赖关系解决</p><h2 id="安装" tabindex="-1"><a class="header-anchor" href="#安装" aria-hidden="true">#</a> 安装</h2><p>1.安装扩展源</p><p>sudo yum -y install epel-release</p><p>2.安装python-pip模块</p><p>sudo yum install python-pip</p><p>3.查看docker-compose版本</p><p>docker-compose version</p><h3 id="错误处理-提示未找到命令" tabindex="-1"><a class="header-anchor" href="#错误处理-提示未找到命令" aria-hidden="true">#</a> 错误处理-提示未找到命令</h3><p>4.通过以命令进行安装</p><p>cd /usr/local/bin/</p><p>wget https://github.com/docker/compose/releases/download/1.14.0-rc2/docker-compose-Linux-x86_64</p><p>rename docker-compose-Linux-x86_64 docker-compose docker-compose-Linux-x86_64</p><p>chmod +x /usr/local/bin/docker-compose</p><h3 id="_5-再通过docker-compose-version命令进行查看" tabindex="-1"><a class="header-anchor" href="#_5-再通过docker-compose-version命令进行查看" aria-hidden="true">#</a> 5.再通过docker-compose version命令进行查看</h3><p>?著作权归作者所有：来自51CTO博客作者素颜猪的原创作品，如需转载，请注明出处，否则将追究法律责任 解决docker-compose 命令不存在、未找到命令错误 https://blog.51cto.com/suyanzhu/2393729</p><p>docker-compose not found、docker-compose命令不存在</p><p>centos 7中python-pip模块不存在，是因为像centos这类衍生的发行版，源跟新滞后，或者不存在。即使使用yum去search python-pip也找不到软件包。</p><p>为了使用安装滞后或源中不存在的安装包，需要安装扩展源EPEL。扩展源EPEL(http://fedoraproject.org/wiki/EPEL) 是由 Fedora 社区打造，为 RHEL 及衍生发行版如 CentOS、Scientific Linux 等提供高质量软件包的项目。</p><p>安装扩展源：sudo yum -y install epel-release</p><p>安装python-pip模块：sudo yum install python-pip</p><p>执行./docker-compose up -d</p><p>[root@fd240 bin]# ./docker-compose</p><p>Cannot open self /usr/local/bin/docker-compose or archive /usr/local/bin/docker-compose.pkg</p><p>解决办法：</p><p>进入下面的网址下载目前的最新版：</p><p>https://github.com/docker/compose/releases/tag/1.14.0-rc2</p><p>网页拉到最下面，下载：</p><p>docker-compose-Linux-x86_64</p><p>然后将文件上传到 /usr/local/bin/ 文件夹下，然后将其重命名为docker-compose，修改此文件的权限，增加可执行：chmod +x /usr/local/bin/docker-compose</p><p>然后再运行</p><p>[root@fd240 bin]# docker-compose version</p><p>docker-compose version 1.14.0-rc2, build 24dae73</p><p>docker-py version: 2.3.0</p><p>CPython version: 2.7.13</p><p>OpenSSL version: OpenSSL 1.0.1t 3 May 2016</p><p>可以看到已经没有问题了。</p><h2 id="默认登录密码" tabindex="-1"><a class="header-anchor" href="#默认登录密码" aria-hidden="true">#</a> 默认登录密码</h2><p>请通过以下方式访问: URL: http://$LOCAL_IP:80 用户名: admin 初始密码: dataease</p>',47),s=[r];function d(t,n){return o(),p("div",null,s)}const h=e(c,[["render",d],["__file","dataease.html.vue"]]);export{h as default};
